    for row in range(app.rows):
        for col in range(app.cols):
            fill = random.choice(['red', 'blue', 'green', 'yellow'])
            (x0, y0, x1, y1) = getCellBounds(app, row, col)
            canvas.create_rectangle(x0, y0, x1, y1, fill=fill ,outline="Black")

